import React from 'react';
import { Button } from '@material-ui/core';
import { useHistory } from 'react-router-dom';

function RegistrationBox() {
  const history = useHistory();

  function handleStudentRegistrationClick() {
    history.push('/student-registration');
  }

  function handleMentorRegistrationClick() {
    history.push('/register');
  }

  return (
    <div className='registerF'>
      <div className='btnArea'>
        <div>
          <h2> Register</h2>
        </div>
        <br />
        <br />
        <Button size="large" variant="contained" color="primary" onClick={handleStudentRegistrationClick}>
          Register as a Student
        </Button>
        <br />
        <Button size="large" variant="contained" color="primary" onClick={handleMentorRegistrationClick}>
          Register as a Mentor
        </Button>
      </div>
    </div>
  );
}

export default RegistrationBox;
